import React from "react";
const Nav=({filterItem,menuList})=>{
   

    return(
        <>
         <nav className="navbar container navbar-expand-lg navbar-light bg-light">
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo03" aria-controls="navbarTogglerDemo03" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <a className="navbar-brand" href="#">SOFTMAN</a>

  <div className="collapse navbar-collapse" id="navbarTogglerDemo03">
    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
    {
        menuList.map(()=>{
            return (
                <> <li className="nav-item active">
      <button className="btn btn-primary" onClick={()=>filterItem("breakfast")}>Breakfast</button>
      </li>
      <li className="nav-item">
      <button className="btn btn-primary"  onClick={()=>filterItem("lunch")}>Lunch</button>
      </li>
      <li className="nav-item">
      <button className="btn btn-primary"  onClick={()=>filterItem("evening")}>Evening</button>
      </li>
      <li className="nav-item">
      <button className="btn btn-primary"  onClick={()=>filterItem("dinner")}>Dinner</button>
      </li>
     

                </>
            )
        })
    }
     
    </ul>
  
  </div>
</nav>
      
      
    
        </>
    )
}
export default Nav;
